import React from 'react';
import { Link } from 'react-router-dom';

const Layout = ({ children }) => {
  return (
    <div className="flex min-h-screen">
      {/* Left sidebar */}
      <div className="w-80 bg-blue-600 text-white p-6">
        <h1 className="text-2xl font-bold mb-8">Audiology Plus</h1>
        <nav className="space-y-4">
          <Link to="/" className="flex items-center space-x-3 text-white">
            <span className="w-6 h-6 bg-white rounded-full flex items-center justify-center text-blue-600">
              <svg xmlns="http://www.w3.org/2000/svg" className="h-4 w-4" viewBox="0 0 20 20" fill="currentColor">
                <path d="M10 9a3 3 0 100-6 3 3 0 000 6zm-7 9a7 7 0 1114 0H3z" />
              </svg>
            </span>
            <span>Primary Contact</span>
          </Link>
          {/* Add other navigation items here */}
        </nav>
        <div className="mt-auto pt-6">
          <p className="text-sm">All rights reserved @AudiologyPlus</p>
        </div>
      </div>

      {/* Main content area */}
      <div className="flex-1 p-8 bg-gray-100">
        {children}
      </div>
    </div>
  );
};

export default Layout;
